ACTION_OBDC_GetEnvdObdByPid( IN<PID_req>, IN<frf_idx>, INOUT <Buffer>, OUT<data_size>)
This action returns the environmental OBD data related to the requested PID and freeze frame
Parameter Type Hex. limits Phys. limits Resol. Unit
PID_req IN 0...FFH 0...255 1 -
PID of the environmental OBD data requested
frf_idx IN 0...FFH 0...255 1 -
index of the freeze frame requested
Buffer INOUT 0...2Byte 0...2Byte 1 -
buffer ?lled up with requested environmental OBD data
data_size IN 0...2H 0...2 1 -
size of requested environmental OBD data
Requirements for ACTION_OBDC_GetEnvdObdByPid:
search for PID in con?guration table service_2_tbl:
eobd_index = 0;
pid_found = 0;
Do
{
If (service_2_tbl[eobd_index].pid == PID_req)
Then pid_found = 1;
Else pid_found = 0;
eobd_index++;
EndIf
} While ((eobd_index <SERVICE_2_TBL_LEN) && (!pid_found));
If(1) (pid_found == 1)
Then(1)
get ENVD_OBD of the requested PID
ptr_conv_data = &( tbl_frf[frf_idx].envd_obd[ service_2_tbl[eobd_index].offset ] );
temp_union = c_eobd_format ( NC_EOBD_SERVICE2_CODE,
service_2_tbl[eobd_index].conv_idx,
&data_out_type,
ptr_conv_data
);
Switch (data_out_type)
Case U_BYTE_FORMAT:
*( Buffer++) = temp_union.u_byte;
data_size = 1;
Case U_WORD_FORMAT:
*( Buffer ++) = u8_get_u16_u8(temp_union.u_word, 1)
*( Buffer ++) = u8_get_u16_u8(temp_union.u_word, 0)
data_size = 2;
Case S_BYTE_FORMAT:
*( Buffer ++) = temp_union.s_byte
data_size = 1;
